# import logging so we can write messages to the logimport logging# import the class DbHandler to interact with the databaseimport db_handlerclass review():    def __init__(self):        logging.info('Initializing review')        self.rev_DbHandler=db_handler.DbHandler()        self.rev_score = ""        self.rev_review = ""        self.rev_date = ""        self.rev_email_service_provider = ""        self.rev_email_dog_owner = ""    def insertToDb(self):        # Inserting the object of owner to the DB        self.rev_DbHandler.connectToDb()        cursor = self.rev_DbHandler.getCursor()        sql = """INSERT INTO Request(Score,Review,S_P_Email,D_O_Email,Date_Of_Review) VALUES(%s,%s,%s,%s,sysdate())"""        cursor.execute(sql, (self.rev_score, self.rev_review,self.rev_email_service_provider,self.rev_email_dog_owner,self.rev_date))        self.req_DbHandler.commit()        self.req_DbHandler.disconnectFromDb()        return